import React, { useState, useEffect } from 'react';
import getClientAuthToken from './api/OAuth';
import './App.css';

import axios from 'axios';
const App = () => {
  const [token, setToken] = useState(null);

  useEffect(() => {
    setToken(getClientAuthToken());
  }, []);

  console.log(token);
  const handleOnClick = () => {
    const baseURL = "https://us.api.blizzard.com/data/wow/";
    axios({
      method: 'get',
      url: `${baseURL}creature-family/index?locale=en_US`,
      headers: {
        Authorization: `Bearer ${token.data.access_token}`,
        "Battlenet-Namespace": "static-classic-us",
      }

    })
      .then(function(response) {
        console.log(response);
      })
      .catch(function(error) {
        console.log(error);
      });
  };




  return (
    <div className="App">
      <button
        onClick={handleOnClick}
      >
        Click Me
      </button>
    </div>
  );
};

export default App;
